import { useState } from "react";
import useLoading from "../utils/Loading";

function Other() {

    const [ text, setText ] = useState("LOL")

    let loadedRender = () => { return <p>{text}</p> }

    const [ isLoaded, setIsLoaded, render ] = useLoading(loadedRender)

    setTimeout( () => { setText("LOOOOOOL") }, 3000)


}

export default Other;
